		return <li key={key}>{key} : {props.ingredients[key]}</li>
	}
	return (
		<div>
			<h3> Your Order </h3>
			<p> A delicious burger with following ingredients: </p>
			<ul>

			</ul>

		</div>
	)
}

export default orderSummary;
